import React from "react";
import Link from "next/link";

function Footer() {
  return (
    <footer class="bg-yellow-400">
      <div class="container mx-auto  px-8">
          <div class="w-full flex flex-col md:flex-row py-4 items-center">
            <p class="uppercase text-black md:mb-6">Made with love -- Rosalie Prom</p>
          </div>
        </div>
    </footer>
  );
}

export default Footer;
